import React from 'react';
import './Header.css';
import model3d from '../assets/final_island_2.glb'

function Header() {
  function abc() {
    const modelViewer = document.querySelector('#orbit-demo');
    const orbitCycle = [
      '45deg 55deg 4m',
      '-60deg 110deg 2m',
      modelViewer.cameraOrbit
    ];
  
    setInterval(() => {
      const currentOrbitIndex = orbitCycle.indexOf(modelViewer.cameraOrbit);
      modelViewer.cameraOrbit =
          orbitCycle[(currentOrbitIndex + 1) % orbitCycle.length];
    }, 3000);
  }
  return (
    <header>
      <model-viewer alt="3d model" src={model3d} camera-controls disable-zoom></model-viewer>
      
    </header>
  );
}

export default Header;
